import "./content.css"
import keyImage from "../assets/images/key-concepts.png"
function Content(){
    return(
      <div>
    
        <img src={keyImage}></img>
        <h2>Key React Concepts</h2>
        <p>Selected key React concepts you should know about</p>
       
      </div>
    )
}
export default Content;
